import ADD_TODO from '../actions';

export const initialState = {
    todoList: [
        {
            item: 'Learn about reducers',
            completed: false,
            id: 3892987589,
        },
    ],
};

export const reducer = () => {
    return {
        todoList: [
            {
                item: 'Learn about reducers',
                completed: false,
                id: 3892987589,
            },
        ],
    };
};
